			"job_description": "JOB INFORMATION\n\nJob Title: Python Developer\n\nLocation: Richardson, TX (Onsite)\n\nRole: Long Term Contract\n\n3-5+ years of relevant work experience in a team-focused environment.\n\n\" Independently develop software primarily to support the Extract, Transform, and Load (ETL) functionality for loading data to a data warehouse allowing business analysts and functional leaders to action business decisions based on that data.\n\n\" Write software using Python and Spark to automate data ingestion and data processing into the Analytical Data Warehouse.\n\n\" Work daily with product owner and interfacing teams to deliver business requirements for Consumer Cards Data Warehouse and reporting systems.\n\n\" General knowledge of business processes, data flows and the quantitative models that generate or consume data\n\n\" In-depth knowledge of relational and columnar SQL databases, including database design\n\n\" Experience in Databricks, Snowflake, Tableau\n\n\" Excellent communications skills and the ability to work with subject matter expert to extract critical business concepts\n\n\" Strong work ethic, a sense of ownership and urgency\n\n\" Strong analytical and problem solving skills\n\n\" Working knowledge of at least one programming language (Python, Java, C++, C#, etc.)",
